import React from 'react';
import '../../App.css';
import Footer from '../Footer';
import CaroCard from '../CaroCard';
import AboutMe from '../AboutMe';

function About(){
  return (
    <>
        <h1 className='about'>ABOUT wip</h1>
        <AboutMe />
        <CaroCard /> 
        <Footer />
    </>
 );
}

export default About;
